class Solution {
    func getGoodIndices(_ variables: [[Int]], _ target: Int) -> [Int] {
        var goodIndices: [Int] = []
        for i in 0..<variables.count {
            let variable = variables[i]
            let (a, b, c, m) = (variable[0], variable[1], variable[2], variable[3])
            if (((a * b % 10).exponentiate(c) % m) == target) {
                goodIndices.append(i)
            }
        }
        return goodIndices
    }
}

extension Int {
    func exponentiate(_ exponent: Int) -> Int {
        var result = 1
        for _ in 0..<exponent {
            result = (result * self) % 10
        }
        return result
    }
}
